import React from 'react'
import Detailes from '../Detailes';
import { v4 as uuid } from "uuid";
import { Link } from "react-router-dom";

function Suggesstions(props) {
  const { Suggestions, serchText } = props;
  if (Suggestions === "" && serchText) {
    return (
      <ul>
        <li>Not matched</li>
      </ul>
    );
  } else {
    return (
      <ul className="bg-white">
        {Suggestions && Suggestions.map((item) => {
          return (
            <div className="bg-ligth">
              <img className="img-fluid" height="20px" width="20px" src={require("../assets/Images/lunch.jpg")} alt="" />
              <Link to={`/details/${item._id}`} onClick={<Detailes ResId={item._id} />} key={uuid()} className="btn border-0">{`${item.name},${item.city}`}
              </Link>
            </div>
          )
        })}
      </ul>
    );
  }
}

export default Suggesstions
